  [PolygonGUID] uniqueidentifier DEFAULT newid() NOT NULL
, [Name] nvarchar(254) NOT NULL
, [Left] float NULL
, [Top] float NULL
, [Right] float NULL
, [Bot] float NULL
, [Data] ntext NULL
);
